INSERT INTO notice (num, type, title, content, reg_date) 
VALUES 
 (1, 'N', '보조배터리 기내반입 절차', '최근 온라인 구인구직 사이트에서 진에어 직원을 사칭하며, 여행 관련 문서 작성 등 특정 업무를 제안하고 피싱 사이트로 회원가입을 유도하는 사례가 제보되고 있습니다.\n\n진에어는 공식 채용 사이트(https://jinair.recruiter.co.kr/)를 통해서만 채용 정보 제공 및 지원서를 접수하고 있으며,\n어떠한 경우에도 개인적인 연락을 통해 고객 개인정보를 요구하거나 수집하지 않습니다.\n\n또한 진에어 공식 홈페이지(https://www.jinair.com/)와 유사한 주소를 가진 피싱 사이트를 통해 개인정보가 유출될 수 있으니 각별한 주의를 부탁드립니다.\n\nFly, better fly Jin Air', '2025-04-01 09:00:00'),
 (2, 'N', '[한국발 외] 국제선 유류할증료 (2025년 4월)', '태국으로 입국하시는 태국 국적외 모든 승객께서는 2025년 5월 1일부터 사전 온라인 입국 신고(TDAC)를 등록하셔야 하오니 참고하여 주시기 바랍니다.\n\nㅇ 시기 : 2025년 5월 1일 부\nㅇ 대상 : 태국에 입국하는 모든 외국인\nㅇ 주요 내용\n    - TDAC의 경우 태국 입국 외국인 대상 의무적으로 온라인 등록 필요\n    - 여행 3일 전부터 등록 가능\n    - 등록 완료 후 이메일로 받은 확인 QR코드를 입국 심사관에게 제시\n    - 태국 도착 전 TDAC 미 발급 시 태국 공항 입국장 셀프 키오스크 통하여 발급 가능\n    - TDAC 등록 웹사이트 : 공식 웹사이트 바로가기\n    - 기존의 종이 입국 카드(TM6)의 경우 유효하지 않음\n\nFly, better fly Jin Air', '2025-04-02 09:00:00'),
 (3, 'N', '[한국 출발] 국제선 유류할증료 (2025년 5월)', '베트남 출발 여정 여행 시 최소 4시간 이상 지연될 경우, 베트남 민간 항공법에 따라 일정 기준의 보상을 받을 수 있습니다.\n여객의 권리에 대한 자세한 내용은 고객센터로 문의하시거나 아래 관련 법령을 참고해 주세요.\n\nFly, better fly Jin Air', '2025-04-03 09:00:00'),
 (4, 'N', '[한국발 외] 국제선 유류할증료 (2025년 4월)', '승객 여러분의 안전한 여행을 위해 보조배터리 기내 반입 규정을 안내드립니다.\n\n1. 시행 \n   ㅇ 2025년 3월 1일(토) 06시 부\n\n2. 보조배터리 기내 반입 안내\n   ㅇ 기내 반입을 위해 단락 방지 조치는 필수입니다. (다음 3가지 중 하나의 방법으로 조치)\n     - 비닐봉투, 보호용 파우치에 1개씩 분리 보관\n     - 단자에 테이프 부착\n     - 단자 보호용 캡 부착\n\n   ㅇ 보조배터리 및 전자담배를 충전하거나 기내 선반에 보관은 엄격히 금지하고 있습니다. \n   ㅇ 반드시 직접 휴대하거나 좌석 앞주머니에 보관해주시고 미사용시에는 봉투에 넣어주세요.\n   ㅇ 보조배터리가 과열되거나 부풀어 오르면 즉시 승무원에게 알려주세요.\n\nFly, better fly Jin Air', '2025-04-04 09:00:00'),
 (5, 'N', '[한국 출발] 국제선 유류할증료 (2025년 5월)', '최근 온라인 구인구직 사이트에서 진에어 직원을 사칭하며, 여행 관련 문서 작성 등 특정 업무를 제안하고 피싱 사이트로 회원가입을 유도하는 사례가 제보되고 있습니다.\n\n진에어는 공식 채용 사이트(https://jinair.recruiter.co.kr/)를 통해서만 채용 정보 제공 및 지원서를 접수하고 있으며,\n어떠한 경우에도 개인적인 연락을 통해 고객 개인정보를 요구하거나 수집하지 않습니다.\n\n또한 진에어 공식 홈페이지(https://www.jinair.com/)와 유사한 주소를 가진 피싱 사이트를 통해 개인정보가 유출될 수 있으니 각별한 주의를 부탁드립니다.\n\nFly, better fly Jin Air', '2025-04-05 09:00:00'),
 (6, 'N', '태국 입국 외국인 대상 TDAC(태국 디지털 입국 카드) 시행(5/1~)', '태국으로 입국하시는 태국 국적외 모든 승객께서는 2025년 5월 1일부터 사전 온라인 입국 신고(TDAC)를 등록하셔야 하오니 참고하여 주시기 바랍니다.\n\nㅇ 시기 : 2025년 5월 1일 부\nㅇ 대상 : 태국에 입국하는 모든 외국인\nㅇ 주요 내용\n    - TDAC의 경우 태국 입국 외국인 대상 의무적으로 온라인 등록 필요\n    - 여행 3일 전부터 등록 가능\n    - 등록 완료 후 이메일로 받은 확인 QR코드를 입국 심사관에게 제시\n    - 태국 도착 전 TDAC 미 발급 시 태국 공항 입국장 셀프 키오스크 통하여 발급 가능\n    - TDAC 등록 웹사이트 : 공식 웹사이트 바로가기\n    - 기존의 종이 입국 카드(TM6)의 경우 유효하지 않음\n\nFly, better fly Jin Air', '2025-04-06 09:00:00'),
